//ajax breaking news
function doXhr(url, params, cb) {
	var xhr = new XMLHttpRequest();

	xhr.onreadystatechange = function () {
		if (xhr.readyState === 4) {
			cb(xhr.response);
			return xhr.response;
		}
	};
	xhr.open('GET', url);
	xhr.setRequestHeader('Content-Type', 'text/plain');
	xhr.send(JSON.stringify(params));
}

