$(document).ready(function() {
    var html = $('html'),
        body = $('body'),
        scrollTop;
        $.lockBody = function() {
            if($(window).scrollTop()) {
                scrollTop = $(window).scrollTop();
                html.css({ overflow: 'hidden'})
                body.css({ top: - (scrollTop), position: 'fixed', width: '100%', overflow: 'hidden'});
            }
        }
        $.unlockBody = function() {
            html.css({ overflow: ''})
            body.css({ top: '', position: '', width: '', overflow: ''});
            window.scrollTo(0, scrollTop);
        }
    $(window).scroll(function() {
        $('.body-break:not(.done)').each(function(index) {
            var i = $(this).attr('data-break')
            if($(window).scrollTop() + $(window).height() >= $(this).offset().top + $(this).outerHeight() + 45){
                if(i%2==0){
                    $.lockBody()
                    $(this).addClass('done').closest('html').find('.body-progress').show().find('.body-progress-infinite-inner').animate({width: '100%'}, 3000).queue(function(){
                        $(this).closest('html').find('.body-progress').hide().find('.body-progress-infinite-inner').animate({width: '0'}, 0).dequeue()
                        $.unlockBody();
                    })
                }
            }
        })
    });
})
